import React from "react";
import { TrackType } from "../types/Types";
import "../components/TrackList.css";

interface Props {
  data: TrackType;
  onUpdate: (id: number) => void;
  onDelete: (id: number) => void;
}

const Track: React.FC<Props> = ({ data, onDelete }) => {
  var trackData = data;

  return (
    <tr key={trackData.id}>
      <td>{trackData.id}</td>
      <td>{trackData.title}</td>
      <td>{trackData.artist}</td>
      <td>{trackData.genre}</td>
      <td>{trackData.bpm}</td>
      <td>
        <button className="button" onClick={() => onUpdate(trackData.id)}>
          Update
        </button>
        <button className="button" onClick={() => onDelete(trackData.id)}>
          Delete
        </button>
      </td>
    </tr>
  );
};

export default Track;
